import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
    const [searchTerm, setSearchTerm] = React.useState('');
    const [results, setResults] = React.useState([
        { id: 1, word: 'apple', definition: 'imageUrl: \'https://example.com/apple.jpg\' ' },
        { id: 2, word: 'book', definition: 'a written or printed work consisting of pages glued or sewn together along one side and bound in covers' },
        { id: 3, word: 'cat', definition: 'a small domesticated carnivorous mammal with soft fur, a short snout, and retractable claws' },
        { id: 4, word: 'dog', definition: 'a domesticated carnivorous mammal that has a long snout, an acute sense of smell, nonretractable claws, and a barking, howling, or whining voice' },
    ]);

    const handleSearchTermChange = (event) => {
        setSearchTerm(event.target.value);
    };

    const handleSearch = () => {
        // 검색 로직을 여기에 추가할 수 있습니다.
        console.log(`Searching for: ${searchTerm}`);
    };

    return (
        <div className="App">
            <div className="black-nav">
                <div className="search-bar">
                    <img src={logo} alt="Logo" className="logo" />
                    <input
                        type="text"
                        placeholder="검색"
                        value={searchTerm}
                        onChange={handleSearchTermChange}
                    />
                    <button onClick={handleSearch}>검색</button>
                </div>
            </div>

            <h4>단어퀴즈</h4>

            <main>
                <h1>단어퀴즈배열</h1>
                <p>You searched for: {searchTerm}</p>
                <div className="grid-container">
                    {results.map((result) => (
                        <div key={result.id} className="grid-item">
                            <h3>{result.word}</h3>
                            <p>{result.definition}</p>
                        </div>
                    ))}
                </div>
            </main>
        </div>
    );
}

export default App;
